import * as Items from './Items'
import werk from './img/werk.png';
import chat from './img/chat.png';
import bmi from './img/bmi.png';

function CardData(title, picture, description){
    this.title = title;
    this.picture = picture;
    this.description = description;
}

export var theCards = [];
theCards = [
    new CardData("ss", "okay", "iy"), 
    new CardData("ss", "this is [80] title", "iy")
];



export var cardList = []

for (var i of theCards){
    cardList.push(Card(i.title, i.picture, i.description))
}

function Card(title, picture, description, technology, api, database){
    if (technology == ""){
        technology = "none"
    }
    return (
        <div class="col-md-4 mb-3">
              <div class="card">
                <img src={picture} class="card-img-top" alt="..." />
                <div class="card-body">
                  <h3 class="card-text">
                    {title}
                  </h3>
                  <p>
                    {description}
                  </p>
                  <ul class="list-group list-group-flush">
                    <li class="list-group-item"></li>
                    <li class="list-group-item">Technology: {technology}</li>
                    <li class="list-group-item">API: {api}</li>
                    <li class="list-group-item">Database: {database}</li>
                    <li class="list-group-item"></li>
                    <a href="https://github.com/thepirateboy/werk" class="btn btn-primary">Take me there!</a>
                  </ul>
                </div>
              </div>
            </div>
    )
  }
